import React, { useState, useEffect } from 'react';
import axios from 'axios';

const StockDataFetcher = () => {
  const [stockData, setStockData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5001/get-stock-data')
      .then(response => {
        setStockData(response.data);
      })
      .catch(error => {
        console.error('Error fetching the stock data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Stock Data</h1>
      <ul>
        {stockData.map((stock, index) => (
          <li key={index}>
            <p>Ticker: {stock.ticker}</p>
            <p>Name: {stock.name}</p>
            <p>Volume: {stock.volume.toLocaleString()}</p>
            <p>Price: {stock.price.toFixed(2)}</p>
            <p>Market Cap: {stock.market_cap}</p>
            <p>P/E Ratio: {stock.pe_ratio !== null ? stock.pe_ratio.toFixed(2) : 'N/A'}</p>
            <p>Change Percent: {stock.change_percent.toFixed(2)}%</p>
            <p>50 MA: {stock['50_MA'].toFixed(2)}</p>
            <p>200 MA: {stock['200_MA'].toFixed(2)}</p>
            <p>RSI: {stock.RSI.toFixed(2)}</p>
            <p>Upper BB: {stock.Upper_BB.toFixed(2)}</p>
            <p>Lower BB: {stock.Lower_BB.toFixed(2)}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default StockDataFetcher;
